import React from "react";

import {
	ExploreContainer,
	ExploreTitle,
	ExploreSections,
} from "./Explore.styles";
import { connect } from "react-redux";
import { createStructuredSelector } from "reselect";
import { selectDirectorySections } from "../../redux/directory/directorySelectors";
import MenuItem from "../directory/Directory";

const Explore = ({ sections, titleToFilter, collection }) => {
	console.log(sections);
	console.log(titleToFilter.toUpperCase());

	return (
		<ExploreContainer>
			<ExploreTitle>Explore More</ExploreTitle>
			<ExploreSections>
				{sections.map((section) => console.log(section.title))}
			</ExploreSections>
		</ExploreContainer>
	);
};

const mapStateToProps = createStructuredSelector({
	sections: selectDirectorySections,
});

export default connect(mapStateToProps)(Explore);
